import "./Footer.scss";

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer__container">
        <div className="footer__info">
          <p className="footer__title">Thank you for visiting!</p>
          <div className="footer__info">
            <h2 className="footer__subheading">Get in Touch</h2>
            <p className="footer__text">
              Email:{" "}
              <a href="mailto:info@shopifystore.com">info@shopifystore.com</a>
            </p>
            <p className="footer__text">Phone: (123) 456-7890</p>
            <p className="footer__text">
              Address: 123 Sticker Lane, Keychain City
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Footer;
